// DOM Ready
$(function() {
  // Initialization
var url = 'http://192.168.0.17:8080';
 var socket = io.connect(url);

 var id = sessionStorage.getItem("user");
 var containerName= id.replace(/\./g,'');
        
 alert(containerName);    
 alert('woo');
 socket.emit('load', containerName, function (data) {
 for(var index in data){
  
  getPic(data[index].name,index);
 }
});     
  
function getPic(name,index)
{
socket.emit('getPic', containerName, name, function(data)
{
  if(index==0){
          large = document.getElementById('large');
        large.src = "data:image/png;base64,";
  }
     var gallery = document.getElementById("thumbnails");
     newLI = document.createElement("li");
                  
     var a = document.createElement("a");
                  a.setAttribute("href",data);
                  newLI.appendChild(a);
          
          var img = document.createElement("img");
          img.setAttribute("src",data);
          img.setAttribute("data-idx",index); 
          a.appendChild(img);
                  
                  gallery.appendChild(newLI);

});            
}
var th = document.getElementById('thumbnails');

th.addEventListener('click', function(e) {
  var t = e.target, new_src = t.parentNode.href, 
      large = document.getElementById('large'),
      cl = large.classList,
      lgwrap = document.getElementById('lg-wrap');
      large.src = new_src;

  if(cl) cl.add('hideme');
    if(cl) cl.remove('hideme');

  e.preventDefault();
}, false);
});